/// <summary>
/// Creates a <c>NAVAXDMFImportStatusBusinessEventContract</c> from a <c>DMFDefinitionGroupExecution</c> record.
/// </summary>
/// <param name = "_dmfDefinitionGroupExecution">A <c>DMFDefinitionGroupExecution</c> record.</param>
/// <returns>A <c>NAVAXDMFImportStatusBusinessEventContract</c>.</returns>
public static NAVAXDMFImportStatusBusinessEventContract newFromDMFDefinitionGroupExecution(DMFDefinitionGroupExecution _dmfDefinitionGroupExecution)
{
    var contract = new NAVAXDMFImportStatusBusinessEventContract();
    contract.initialize(_dmfDefinitionGroupExecution);
    return contract;
}

private void initialize(DMFDefinitionGroupExecution _dmfDefinitionGroupExecution)
{     
    DMFDefinitionGroup dmfDefinitionGroup = DMFDefinitionGroup::find(_dmfDefinitionGroupExecution.DefinitionGroup);
    recId               = _dmfDefinitionGroupExecution.RecId;
    entityName          = _dmfDefinitionGroupExecution.Entity;
    legalEntity         = _dmfDefinitionGroupExecution.company();        
    status              = this.getStatus(_dmfDefinitionGroupExecution);
    noOfCreatedRecords  = _dmfDefinitionGroupExecution.NumOfTargetNew;
    noOfUpdatedRecords  = _dmfDefinitionGroupExecution.NumOfTargetUpdated;
    noOfRecords         = _dmfDefinitionGroupExecution.NoOfRecords;
    fileName            = _dmfDefinitionGroupExecution.FilePath;
    executionId         = _dmfDefinitionGroupExecution.ExecutionId;
    startedDateTime     = _dmfDefinitionGroupExecution.StartDateTime;
}

private str getStatus(DMFDefinitionGroupExecution _dmfDefinitionGroupExecution)
{
    DMFExecutionSummaryStatus summaryStatus = _dmfDefinitionGroupExecution.GetExecutionSummaryStatus();
    return enum2Str(summaryStatus);
}

